description:
Yeni Günəşli, A/B yaşayış massivi,129-cu bina,2-ci blok,9-cu mərtəbədə yerləşən 4 otaqlı mənzilimi satıram və barter təklifləri də maraqlıdır.Mənzil Kiyev layihəli,ekspremental tipli binada yerləşir.Bina və mənzilin bir çox özəllikləri vardır və bunlar aşağıdakılardır:,-- bina yol qırağında yerləşir;
,-- eksperemental layihəlidir,o biri binalardan
,fərqli olaraq,mənzillərin sahələrinin daha
,böyük olmasıdır;
,-- binanın damı 2 hissəlidir,yəni 2 damdan
,ibarətdir;
,-- binanın hər iki tərəfində avtobus
,dayanacağı (50 №-li marşrut)
,vardır,Babək pr. sonra,Yeni Günəşli
,qəs.girişində 1-ci və 2-ci dayanacaqların
,arasında yerləşir;
,-- binadan 4-5 dəq,aralıqda, Qartal deyilən
,ərazidəki dayanacaqdan metro - Xalqlar
,Dostluğuna 3-4 dəq,çatmaq olur;
,-- 2025-ci ildə Yeni Günəşlidə metro açılışı
,planlaşdırılır;
,-- 279 №-li məktəb binanın 10 metrliyində
,və uşaq baxçası üz-bəüz binanın
,arxasında 300 metr aralıqda yerləşir;
,-- Araz market qonşu binada,50 metrlik
,məsafədə yerləşir;
,-- bir az aralıqda 500 metr məsafədə Bravo
,və Araz Supermarketləri yerləşir;
,-- binanın qarşısında və yanında maşın
,parklama yerləri və avto yuma məntəqəsi
,vardır;
,-- hər mərtəbədə 2 mənzil vardır;
,-- mənzilimiz aşağı mərtəbələrdəki
,mənzillərdən daha çox sahəyə (12-15
,metr artıq) malikdir;
,-- 2 dayanacaq aralıqda Suraxanı rayonu
,Şəhər Poliklinikası və Təcili Yardım
,məntəqəsi yerləşir,

SƏMƏD VURĞUN KÜÇƏSİNDƏ!,ÖZÜM SATIRAM. MÜLKİYYƏTÇİ,Tibb Universiteti ilə üzbəüz;
,Stalinka layihəli, arxitektur bina;
,Yelçəkən mənzil, həm daxili həyətə, həm də Səməd Vurğun küçəsinə baxışı var;
,Tam təmirli, əşyalarla birgə satılır. ,REAL ALICIYA ENDİRİM OLACAQ!
